import React from 'react';
import './DustCard.css';
import ItemCard from './ItemCard';

function DustCard({ fine, ultraFine }) {
  return (
    <ItemCard title="미세먼지 정보">
      <div className="dust-block">
        <img src="/images/fine.png" alt="미세먼지" width={60} />
        <div className="dust-title">미세먼지</div>
        <div className="dust-status red">나쁨</div>
        <div className="dust-value">{fine} <span>㎍/㎥</span></div>
        <div className="dust-bar red" />
      </div>

      <div className="dust-block">
        <img src="/images/ultrafine.png" alt="초미세먼지" width={60} />
        <div className="dust-title">초미세먼지</div>
        <div className="dust-status yellow">보통</div>
        <div className="dust-value">{ultraFine} <span>㎍/㎥</span></div>
        <div className="dust-bar yellow" />
      </div>

      <p className="card-footer">
        {'>'} 마스크 추천 제품 {'<'}<br />
        {'>'} 미세먼지 건강 정보 {'<'}
      </p>
    </ItemCard>
  );
}

export default DustCard;
